export function main_Growing() {


    // Variables List --------------------------------------------------------------------------------------------------------------------------------------

    sketcher = ChemicalizeMarvinJs.createEditor("#marvin-test");


    // GROWING Sketcher  ---------------------------------------------------------------------------------------------------------------------------------

    //Generation of SMILES (from the sketcher) in the textbox

    sketcher.then(function (marvin) {
        function handleMolChange() {
            marvin.exportStructure("smiles").then(function (smiles) {
                document.getElementById("smilesMolecule").value = smiles;


            });
        }

        marvin.on("molchange", handleMolChange);


        //Button: clear all
        var Clear = {
            name: "Clean Sketcher",
            toolbar: "W",
            imageUrl: "data:image/gif;base64,R0lGODlhGAAYAPMAAORHHOVSKulrSOp3WOyDZu6QdvCchPGolfO0o/XBs/fNwQAAAAAAAAAAAAAAAAAAACH5BAEAAAsALAAAAAAYABgAAARccMlJq7046827/xogAiA1kqV0fog5Ui2WAEGRLGtSBMB9EacAjzYUETCnpBJlGSyXA03CIFAKDD5OQVlgPWMbxUlQHSk4RVSQ4xQdJIdRlHMICCiCwDvF7/v/EhEAOw==",
        };
        marvin.addButton(Clear, function () {
            marvin.importStructure("smiles", " ");
        });


        //Button: tuto
        var tuto = {
            name: "Tutorial",
            toolbar: "W",
            imageUrl: "data:image/gif;base64,",
        };
        marvin.addButton(tuto, function () {
            seeDemo();

            function seeDemo() {
                if (confirm("Launch demo?")) {
                    marvin.importStructure("smiles", "Cc1ccc(N)cc1Nc1nccc(n1)-c1cccnc1");
                    document.getElementById("name").value = "imatinib-frag";
                    document.getElementById("undesired").value = "[#6]N(~O)~O";
                    document.getElementById("required").value = "[H]Nc1c([H])c([H])c(c(N([H])c2nc([H])c([H])c(n2)-c2c([H])nc([H])c([H])c2[H])c1[H])C([H])([H])[H]";


                } else {
                    marvin.importStructure("smiles", " ");
                    document.getElementById("name").value = " ";
                    document.getElementById("undesired").value = " ";
                    document.getElementById("required").placeholder = " ";
                }
            }
        });


        //Button: info
        var Info = {
            name: "Info",
            toolbar: "W",
            imageUrl: "data:image/gif;base64,",

        };

        marvin.addButton(Info, function () {
            window.alert("Draw a fragment ");

        });

    });


}





