		export function SetAtomSelect (num_sketcher,pos,bonds) {
            switch (num_sketcher) {

                case 0:
                    sketcher.then(function(marvin){
                        marvin.setSelection({
                            'atoms' : pos,
                            'bonds' : bonds
                        });
                    });
                    break;
                case 1:
                    sketcher1.then(function(marvin){
                        marvin.setSelection({
                            'atoms' : pos,
                            'bonds' : bonds
                        });
                    });
                    break;
                case 2:
                    sketcher2.then(function(marvin){
                        marvin.setSelection({
                            'atoms' : pos,
                            'bonds' : bonds
                        });
                    });
                    break;
                default:
                    break;
            }

		}
//Generation of the molecule (from the smiles) in the sketcher
export function generateMolSketcherGrowing(smiles){
    sketcher.then(function (marvin) {
        function generateMolSketcher(smiles){
            if(smiles == ""){
                marvin.clear();
            }
            marvin.importStructure("smiles",smiles);
        }
        marvin.on("smiles",generateMolSketcher(smiles));
    });

}
//Generation of the molecule (from the smiles) in the sketcher
export function generateMolSketcherLinking(smiles,numsketch){
    if(numsketch==1) {
        sketcher1.then(function (marvin) {
            function generateMolSketcher(smiles) {
                if (smiles == "") {
                    marvin.clear();
                }
                marvin.importStructure("smiles", smiles);
            }

            marvin.on("smiles", generateMolSketcher(smiles));
        });
    }
    else if (numsketch==2){
        sketcher2.then(function (marvin) {
            function generateMolSketcher(smiles){
                if(smiles == ""){
                    marvin.clear();
                }
                marvin.importStructure("smiles",smiles);
            }
            marvin.on("smiles",generateMolSketcher(smiles));
        });


    }
    else{
        console.log("Error, wrong num sketcher")
    }

}



